import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import '../styles/App.css';
import Navbar from './Navbar';


class Home extends Component {

    render() {
        return (
            <div>
            <Navbar/>
                <div className="container">
                    <div className="row">
                        <div className="col-lg-5 col-md-6 col-sm-12 menu-apps">
                        <Link to="/pemesanan"><img src={require('../static/img/plane.png')} className="imeg1" style={{width:"200px", height:"100px"}} alt=""/>
                        <div className="text">Ticket</div></Link>
                        </div>
                        <div className="col-lg-2 col-md-0 col-sm-12"></div>
                        <div className="col-lg-5 col-md-6 col-sm-12 menu-apps">
                        <Link to="/penukuran"><img src={require('../static/img/exchange.png')} className="imeg" alt="" />
                        <div className="text">Currency Converter</div>
                        </Link>
                        </div>
                    </div>
                </div>
                </div>
            );
    }
}

export default Home;
